import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';
import styled from 'styled-components';

import Card from '../Card/Card';

const RandomRecipe = styled.div`
	display: flex;
	justify-content: center;
	margin: 2rem;
`;

const axios = require('axios');

function RandomRecipes() {
	const recipeUrl = {
		url: 'https://spoonacular-recipe-food-nutrition-v1.p.rapidapi.com/recipes/random',
		params: { number: '3' },
		headers: {
			'X-RapidAPI-Key': '9d9cfe1897msh741bd79fb799e65p10e075jsn75713fa5c441',
			'X-RapidAPI-Host': 'spoonacular-recipe-food-nutrition-v1.p.rapidapi.com',
		},
	};

	const [recipeData, setRecipe] = useState({});

	useEffect(() => {
		getRecipeFetch();
	}, []); //passes in blank array so renders once

	const getRecipeFetch = async () => {
		const response = await axios.get(recipeUrl);
		setRecipe(response.data);
	};

	console.log(recipeData);

	return (
		<RandomRecipe className='card-containers'>
			<Card />
			<Card />
			<Card />
		</RandomRecipe>
	);
}

export default RandomRecipes;
